body {
  overflow: hidden;
  position: fixed;
}

.loader {
  position: fixed;
  background: white;
  width: 100%;
  height: 100%;
  z-index: 30;
  margin: 0;
  display: block;
}

.loadBook {
  width: 200px;
  height: 200px;
  background-image: url('../img/loading.gif');
  background-size: cover;
  background-repeat: no-repeat;
}

.loadText {
  display: inline-block;
  margin-top: 30px;
  font-size: 35px;
  padding: 3px;
  border-radius: 10px;
  text-align: center;
  font-family: Georgia, 'Times New Roman', Times, serif;
  color: rgba(34,193,195,1);
  animation-name: loading;
  animation-duration: 2s;
  animation-timing-function: linear;
  animation-iteration-count: infinite;
}

.mAuto {
  margin-left: auto;
  margin-right: auto;
}

@keyframes loading {
  0% {
    border-bottom: 2px solid black;
    border-left: 2px solid black;
  }
  20% {
    border-bottom: none;
    border-top: 2px solid black;
  }
  40% {
    border-left: none;
    border-right: 2px solid black;
  }
  60% {
    border-top: none;
    border-bottom: 2px solid black;
  }
  80% {
    border-right: none;
    border-left: 2px solid black;
  }
  90% {
    border-bottom: none;
    border-top: 2px solid black;
  }
  100% {
    border-left: none;
    border-right: 2px solid black;
  }
 }

.logo {
  width: 110px;
  height: 85px;
  padding-bottom: 5px;
  pointer-events: none;
}

/*style for a tag links*/
a {
  text-decoration: none;
  color: white; 
}

a:hover {
  text-decoration: none; 
}

/*style for header*/
header {
  width: 100%;
  height: 85px;
  position: fixed;
  top: 0;
  left: 0;
  line-height: 75px;
  z-index: 20;
  text-align: center;
  overflow: hidden;
  font-size: 19px;
  
}

header a:hover {
  color: #7f8c8d
}

header a {
  margin-left: 30px;
  margin-right: 30px;
  cursor: pointer;
  color: #ecf0f1;
  transition: 0.5s;
  transition-property: all; 
}


body {
  background: url('../img/back.jpg') center no-repeat;
  background-position: center center;    
  background-repeat: no-repeat;    
  background-attachment: fixed;    
  background-size: cover;   
}

/* burger */

.burger_wrapper  {
  position: absolute;
  display: none;
  width: 70px;
  height: 70px;
  padding: 20px;
  right: 50px;
  top: 5px;
  cursor: pointer;
  transition: 0.6s;
}

.burger_wrapper_active .burger {
  transform: rotate(45deg);
}

.burger_wrapper_active .burger:before {
  top: 0;
  transform: rotate(90deg);
}

.burger_wrapper_active .burger:after {
  top: 0;
  transform: translateY(-1000px)
}


.burger {
  display: block;
  content: '';
  height: 3px;
  width: 70px;
  background: white;
  margin-top: 10px;
  transition: 0.6s;
}

.burger:before {
  content: '';
  display: block;
  height: 3px;
  width: 70px;
  background: white;
  position: relative;
  top: 11px;
  transition: 0.6s;
}

.burger:after{
  content: '';
  display: block;
  height: 3px;
  width: 70px;
  background: white;
  position: relative;
  top: 20px;
}

.burger_items {
  position: fixed;
  width: 60%;
  height: 100%;
  background: rgba(0, 0, 0, 0.8);
  z-index: 100;
  display: flex;
  transform: translateX(-5000px);
  flex-flow: column nowrap;
  justify-content: flex-start;
  align-items: center;
  transition: 0.6s;
}

.burger_items a:first-child {
  margin-top: 100px;
}

.burger_items a {
  margin-top: 40px;
  font-family: 'Joane';
  color: white;
  font-size: 24px;
  transition: 0.2s;
}

.burger_items a:hover {
  color: rgba(241,228,228,0.8);
  font-size: 25px;
  transition: 0.2s;
  text-decoration: none;
}

/* font-size */
.fs24 {
  font-size: 24px;
}

.fs20 {
  font-size: 20px;
}

.fs18 {
  font-size: 18px;
}

/*center vertically & horizontally*/
.vertical-align {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%); 
}

/*home container size*/
.screenSize-container {
  width: 100%;
  height: 100vh; 
}

.homeCont {
  width: 900px;
}

/*own color classes*/
.transBlack-container {
  background-color: rgba(0, 0, 0, 0.9); 
}

.transWhite-container {
  background-color: rgba(255, 255, 255, 0.9); 
}

.submisOfdoc {
  background: url("../img/submisOfDoc.jpg") no-repeat;
  background-size: cover;
}

.list-group-item_bold {
  position: relative;
  display: block;
  padding: .75rem 1.25rem;
  margin-bottom: -1px;
  background-color: #fff;
  border: 2px solid black;
  border-radius: 3px;
  font-size: 18px;
  text-align: center;
  font-weight: 600;
}
.list-group-item_mod {
  position: relative;
  display: block;
  padding: .75rem 1.25rem;
  margin-bottom: -1px;
  background-color: #fff;
  border-radius: 5px;
  margin-bottom: 2px;
  border: 1px solid rgba(0,0,0, 0.3);
}

.submisOfdocText {
  font-family: 'Joane';
  color: white;
  font-size: 30px;
  margin-top: 22px;
  background-color: rgba(0, 0, 0, 0.2);
  border-radius: 100px;
}

.joaneFont {
  font-family: 'Joane';
}

.entrance, .prof {
  width: 200px;
  height: 40px;
  border-radius: 10px;
  border: none;
  margin-top: 30px;
  font-family: 'Joane', serif;
  font-size: 24px;
  margin-bottom: 24px;
}

.entrance {
  margin-right: 15px;
}

.prof {
  margin-left: 15px;
}

.entrance:focus, .prof:focus {
  outline: none;
}

.entrance:after, .prof:after {
  content: '';
  display: block;
  width: 100%;
  height: 2px;
  border-radius: 10px;
  background: rgba(0, 0, 0, 0.4);
  transition: 1s;
  transform: translateY(-3px);
}

.entrance:hover:after, .prof:hover:after {
  transform: translateY(10px);
  transition: 1s;
}

.entranceText {
  font-size: 22px;
  margin-top: 12px;
  font-weight: 600;
  margin-top: 15px;
}

/* dropList */
.dropList {
  position: absolute;
  left: -6000px;
}

.drop_active {
  position: relative;
  transition: 1s;
  left: 0px;
}

.enterText {
  font-family: 'Joane';
  font-size: 36px;
  color: black;
  text-align: center;
}

.enrollText {
  font-family: 'Neuville';
  font-size: 24px;
  text-align: center;
}

.enrTexElem {
  font-family: 'Neuville';
  font-size: 18px;
  text-align: center;
}

#specialization {
  background: url("../img/specialization.jpg") no-repeat;
  background-size:cover;
  padding-bottom: 30px;
}

.imgSpec {
  max-width: 750px;
  max-height: 800px;
  margin: 0 auto 0 auto;
}

.imgSpec img {
  width: 100%;
  height: 100%;
}

.specText {
  font-family: 'Joane';
  color: black;
  font-size: 38px;
  margin-top: 22px;
  background-color: rgba(255, 255, 255, 0.6);
  border-radius: 100px;
}

.priceBack {
  background: url("../img/PriceBack.jpg") no-repeat;
  background-size: 100%;
  background-size:cover;
}

.tableText {
  font-family: 'Neuville';
  font-size: 24px;
  color: rgb(14, 4, 42);
  text-align: center;
}

.tableText_item {
  font-family: 'Neuville';
  font-size: 18px;
  color: rgb(14, 4, 42);
  text-align: center;
}

#contactme {
  background: url("../img/maps.jpg") no-repeat;
  background-size:cover;
  height: 800px;
}

#map {
  border-radius: 10px;
  width: 100%;
  border-radius: 30px;
  padding: 20px;
  padding-bottom: 20px;
  border: 4px solid orange;
  height: 400px;
  box-shadow: 2px 10px 10px 10px white;
}


.footerWrapper {
  background: linear-gradient(0deg, rgba(255,184,0,1) 0%, rgba(241,228,228,1) 83%);
}

.social-footer {
  width: 25px;
  height: 25px;
  margin-right: 10px;
  transition: 0.5s;
}

.social-footer:hover {
  transform: translateY(5px);
  box-shadow: 1px 1px 1px 1px rgba(0, 0, 0, 0.6);
  transition: 0.5s;
}


/* fonts */
@font-face {
  font-family: 'Joane';
  font-display: swap;
  src: local('../font/Joane Ultra bold'), local('Joane-Ultra-bold'),
      url('../font/Joane-Ultrabold.woff2') format('woff2'),
      url('../font/Joane-Ultrabold.woff') format('woff'),
      url('../font/Joane-Ultrabold.ttf') format('truetype');
  font-weight: 800;
  font-style: normal;
}

@font-face {
  font-family: 'Neuville';
  font-display: swap;
  src: local('../font/Neuville'),
      url('../font/Neuville.eot?#iefix') format('embedded-opentype'),
      url('../font/Neuville.woff2') format('woff2'),
      url('../font/Neuville.woff') format('woff'),
      url('../font/Neuville.ttf') format('truetype');
  font-weight: normal;
  font-style: normal;
}

/* adaptaining */

@media (max-width: 1200px) {

  .enrTexElem {
    font-size: 24px;
  }
  
  .enrollText {
    font-size: 32px;
  }
}

@media (max-width: 992px) {

  .homeCont {
    width: 800px;
  }

  header a {
    display: none;
  }

  .burger_wrapper {
    display: block;
  }
  
  .burgerActive {
    transform: translateX(0);
  }
  
  .imgSpec {
    max-width: 600px;
    max-height: 500px;
    margin: 0 auto 30px auto;
  }

  /* body {
    background: url('../img/back.jpg') center no-repeat;
    width: 100%;
    height: 100%;
    background-attachment: fixed;
  }

  .wrapper_home {
    background: url('../img/back.jpg') center no-repeat;
  } */

  .tableText {
    font-family: 'Neuville';
    font-size: 14px;
    color: rgb(14, 4, 42);
    text-align: center;
  }
  
  .tableText_item {
    font-family: 'Neuville';
    font-size: 12px;
    color: rgb(14, 4, 42);
    text-align: center;
  }

}

@media (max-width: 768px) {
  .loadText {
    font-size: 26px;
  }

  .homeCont {
    width: 500px;
  }

  .wrapper_home {
    background-image: url('../img/backSmall.jpg');
    width: 100vw;
    min-height: 100vh;
    background-repeat: no-repeat;
  } 

  body {
    background-image: url('../img/PriceBack.jpg');
    background-size: cover;
  }

  .submisOfdocText {
    font-size: 26px;
  }
}

@media (max-width: 576px) {
  .homeCont {
    width: 400px;
  }

  .tableText {
    font-family: 'Neuville';
    font-size: 10px;
    color: rgb(14, 4, 42);
    text-align: center;
  }
  
  .tableText_item {
    font-family: 'Neuville';
    font-size: 8px;
    color: rgb(14, 4, 42);
    text-align: center;
  }
}
